import React, { Component } from 'react'

export class LearnGit extends Component{
  render(){
    return(
      <div className="git">
        Let's look at creating a new repository in VSCode and adding it to Github.
        <p>Initialize your workspace via the command line:</p>
        <pre>
          <code>
            git init
          </code>
        </pre>
      </div>
    )
  }
}
